import React, {useEffect, useState} from "react";

import Particles, {initParticlesEngine} from "@tsparticles/react";
import {loadFull} from "tsparticles";
import "../App.css";
import particlesOptions from "../particles.json";
import 'bootstrap/dist/css/bootstrap.min.css';
import { NavBar } from "../components/NavBar";
import { Footer } from "../components/Footer";
import { Col, Row, Container } from "react-bootstrap";
import GreenPathLogo from '../assets/img/GreenPathLogo169.png'



    
function GreenPath(){
    const [init, setInit] = useState(false);

    useEffect(() => {
        if (init) {
            return;
        }

        initParticlesEngine(async (engine) => {
            await loadFull(engine);
        }).then(() => {
            setInit(true);
        });
    }, []);

    const particlesLoaded = (container) => {
        console.log(container);
    };

    return(
        <div className="GreenPath">
            <Particles
                id="tsparticles"
                particlesLoaded={particlesLoaded}
                options={particlesOptions}
            />
            <NavBar/>
            <Container>
                <Row>
                    <Col>
                        <div className="box">
                            
                            <h2>GreenPath KSU Spring 2024 Hackathon</h2>
                            
                            <div className="proj-rows">
                                <div >When I first began brainstorming for the KSU Spring 2024 Hackathon, my initial idea was inspired by Snapshot by Progressive. I had the idea of an app that monitors a driver’s habits, like acceleration and braking, to maximize fuel efficiency. However, as I explored the problem further, I realized there was a better way to reduce carbon emissions. Instead of just focusing on driving behavior, I could optimize routes for CO2 reduction.
                                </div>
                                <img src={GreenPathLogo}  alt="" />
                            </div>
                            <div className="proj-rows">
                                <div>The transition from a driver-monitoring system to a mapping software came from a desire to make the project both practical and universally applicable. Instead of focusing solely on how a person drives, I began to think about how the routes themselves could play a role in reducing carbon emissions. This led to the concept of GreenPath, a mapping tool that considers a vehicle’s unique miles-per-gallon (MPG) performance to calculate the gas usage and carbon emissions for any given trip.&#10;
                                The core idea was to empower drivers to see the environmental impact of their choices in real-time. By taking "green" routes—those optimized for lower fuel consumption—users could track how much CO2 they were saving. This approach shifts the focus from individual driving behavior to making informed decisions on which routes to take.

                                </div>
                                <img src={GreenPathLogo}  alt="" />
                            </div>
                            <div className="proj-rows">
                                <div >One of the key features that emerged from this idea was the ability to track and celebrate the user’s progress in reducing their carbon footprint. I wanted GreenPath to be more than just a utility. It should also motivate people to keep making greener choices. That’s where the idea of milestones and social sharing came in.
The program could encourage users by awarding milestones for reaching certain levels of CO2 reduction, such as saving a ton of CO2. Additionally, users could share their achievements with friends and family, spreading awareness and encouraging others to do the same. This social aspect was crucial in turning GreenPath into a tool that not only facilitates eco-friendly decisions but also creates a community around sustainability.
</div>
                                <img src={GreenPathLogo}  alt="" />
                            </div>
                            <div className="proj-rows">
                                <div >Once we solidified the concept, the challenge was bringing GreenPath to life within the tight hackathon timeframe. I led the team using a condensed Agile methodology, breaking the project into small tasks and holding frequent check-ins. This approach allowed us to quickly iterate on features like the map display and emissions calculations, while offering feedback and suggestions to each other. We focused on our individual strengths and used Git for simple version control. 
My responsibilities included implementing the map display and handling the backend logic for calculating fuel usage and emissions based on vehicle specs. When I encountered an issue with a Python library missing a necessary experimental feature for green route generation, a teammate and I resolved it by making a JSON curl request. In the end, we successfully delivered a working prototype that showcased GreenPath's potential.
</div>
                                <img src={GreenPathLogo}  alt="" />
                            </div>
                            <div className="proj-rows">
                                <div >Putting together the presentation for GreenPath was an important part of our project. I focused on clearly explaining the problem we were addressing and how GreenPath provided a solution. We made sure to highlight how the app helps users choose more eco-friendly routes and track their carbon savings.
When it was time to present, I walked the audience and judges through our project, showing off its key features and demonstrating how it worked. I made sure to prepare for questions from the judges and did a live demo to show the app in action. The feedback we received was really positive, and it felt great to see our hard work recognized.
</div>
                                <img src={GreenPathLogo}  alt="" />
                            </div>
                            <div className="proj-rows">
                                <div >Winning 1st place at the KSU Spring 2024 Hackathon was a tremendous validation of our efforts. It was an honor to be invited to present GreenPath to stakeholders at the headquarters of the sponsoring company. This experience taught me the value of staying adaptable and open to new ideas. I’m proud of what we accomplished and excited about the potential for further development.
                                </div>
                                <img src={GreenPathLogo}  alt="" />
                            </div>
                        </div>
                    </Col>
                </Row>
            </Container>

            <Footer/>
        </div>
        
    );

}   

export default GreenPath;
